import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Hero from "./components/Hero";
import Projects from "./components/Projects";
import Skills from "./components/Skills"; // Make sure the component is created
import Resume from "./components/Resume"; // Make sure the component is created

const App = () => (
  <Router>
    <Navbar />
    <Routes>
      <Route path="/" element={<Hero />} />
      <Route path="/projects" element={<Projects />} />
      <Route path="/skills" element={<Skills />} />  {/* Add Skills route */}
      <Route path="/resume" element={<Resume />} />  {/* Add Resume route */}
    </Routes>
  </Router>
);

export default App;
